import { Meta, StoryObj } from '@storybook/react'
import { fn } from '@storybook/test'
import { MapWithAutocomplete } from "@/components/forms/enter-address/map/map-with-autocomplete";

const meta = {
  component: MapWithAutocomplete,
  tags: ['autodocs'],
  title: 'Forms/EnterAddressForm',
} satisfies Meta<typeof MapWithAutocomplete>

export default meta
type Story = StoryObj<typeof meta>

export const Responsibilities: Story = {
  args: {
    onSendCoords: fn(),
  },
}
